import React, {useEffect} from 'react'
import './Holdings.css'
import TeamCard from './TeamCard'


const Holdings = (props) => {

    const user = props.user
    const teams = props.teams

    const getMyTeams = () =>{
        const myTeams1 = []
        if(user.shares !== 0){
            user.shares.map(s => {
                let shareTeam = s.substring(0,s.length - 4)
                if(!myTeams1.includes(shareTeam)){
                    myTeams1.push(shareTeam)
                }
            })
            return myTeams1
        } 
    }

    return(
        <>
        <div className='Holdings'>   
            {teams.map(t => {
                let indTeams = getMyTeams()
                if(indTeams.includes(t.team)){
                    return <TeamCard key={t.team} user={user} t={t} />
                }
            })}
            <div className="holdings-offers-div">Open Offers to Buy</div>
            <div className="holdings-offers-div">Open Offers to Sell</div>
        </div>
        </>
    )
}

export default Holdings
